import React from 'react';
import styled from 'styled-components'

const Container = styled.div`
    width: 100vw;
    height: 400px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    position: relative;
`

const Time = styled.span`
    font-size: 30px;
    font-weight: 600;
    color: white;
    position: absolute;
    top: 20px;
    left: 20px;
`

export default function Main() {
  return (
    <Container>
        <Time>11 : 52</Time>
    </Container>
  )
}
